import '../../App.css'
import ResumePDF from '../images/DeAnna_Boiani-Resume.pdf'

function Resume() {
    return(
        <div className="resume">
            <h2>Resume</h2>
            <img src={ResumePDF} alt="resume"/>

        </div>
    )
}

export default Resume;
